import '../styles/contact.css';

export default function Contact() {
    return(
        <section className="contact-section">
            <h2>Contact Me Section</h2>
            <form className="contact-container-form">
                <label>
                    Name:
                    <input type="text" name="name"/>
                </label>

            </form>
            <hr/>
        </section>
    );
}
